import React from 'react'
import { FooterData } from './FooterData'
import './Footer.css'


export const Footer = () => {
  return (
    <div className='container footerBg'>
        <footer className='footer'>
            {FooterData.map((footerItem,footerIndex) => {
                return(
                    <div  className={footerItem.footerCLass}>
                        <h4 className={footerItem.footerCs}>{footerItem.fotterTitles}</h4>
                        <p>{footerItem.text}</p>

                        <ul>
                         <li>{footerItem.home}</li>
                         <li>{footerItem.about}</li>
                         <li>{footerItem.career}</li>                           
                        </ul>
                    </div>
                )
            })}
        </footer>
        <p style={{textAlign: 'center',borderTop: '1px solid #000', paddingTop: '10px', color: '#000'}}>Copyright Â© 2023 eGradTutor All rights reserved</p>

    </div>
  )
}
